import './App.css';
import Logo from './assets/logo.svg'

function App() {
  return (
    <div className="container">

      {/* INICIO DA PARTE1 */}
        <div className='topoparte1'>

            {/* INICIO DO CABEÇALHO */}
            <div className='topo'>
                <img src={Logo} alt="" />
            </div>

            <div className='menu'>

                <ul>
                  <li> <a href="">Comprar NFT</a> </li>
                  <li> <a href="">Sobre</a> </li>
                  <li> <a href="">FAQ</a> </li>
                </ul>

            </div>

            <div className='botao-topo'>
              <button className='botao-meta'>Conectar Carteira</button>
            </div>
            {/* FIM DO CABEÇALHO */}

        </div>
        {/* FIM DA PARTE1 */}


        <div className='topoparte2'>
            <div className='texto-nft'>

              <p>
                Mercado Digital para colecionáveis em criptos e tokens não fungível (NFT). <br /> Compre, venda e descubra ativos digitais exclusivos para você.
              </p>

            </div>
        </div>

    </div>
  );
}

export default App;
